import "../App.css";
import InfoImage from "./InfoImage";

function CustomOutput(props) {
  const {
    labelText,
    inputID,
    inputAccuracy,
    defaultValue,
    hasInfoIcon,
    infoImageSource,
    allowChange,
  } = props;
  useEffect(() => {
    if (typeof window?.MathJax !== "undefined") {
      window.MathJax.typeset();
    }
  }, []);
  return (
    <div>
      <label for={inputID}>
