          //     }}
          //   />
          // )
        }
      <input
        type="number"
        id={inputID}
        defaultValue={defaultValue}
        disabled={allowChange}
      ></input>

      {/* <label for="optSumBhi">Calculated sum of all relative bounding box heights &#8721<i>b</i><sub>hi</sub>:</label>
      <input
        type="number"
        id = "optSumBhi"
        defaultValue="3.46"
        disabled="true"
      ></input> */}
    </div>
  );
}

export default CustomOutput;
